	function get_color_array(resultado)
	{	
		var a1=0,a2=0;
		var orden="";
		var razon=1;
		var color_array=[];
		var cn=0;
		var set_option1=function(_orden)
		{
			while(a2>0)
			{
				a1=(_orden==="+")?a1+razon:(_orden==="-")?a1-razon:a1;
				color_array.push(a1);
				a2--;
			}
		};
		var set_option2=function(_orden)
		{
			a2=(_orden===";")?a2*(-1):a2;
			a1+=a2;
			color_array.push(a1);
			razon=a2;
			a2=0;
		}
		var isSymbol=function(value)
		{
			return (value=== "+" || value=== "-" || value=== "*" || value=== "." || value=== ";")?true:false;
		}
		for(var i=0;i<resultado.length;i++)
		{
			if(!isSymbol(resultado.charAt(i)))
			{
				a1+=resultado.charAt(i);
			}
			else
			{
				cn=i;
				color_array.push(parseInt(a1));
				orden=resultado.charAt(i);
				break;
			}
		}
		for(var j=cn+1;j<resultado.length;j++)
		{
			if(!isSymbol(resultado.charAt(j)))
			{
				a2+=resultado.charAt(j);
			}
			else
			{
