				a2=parseInt(a2);
				if(orden==="+" || orden==="-" || orden==="*")
				{
					set_option1(orden);
				}
				else if(orden==="." || orden===";")
				{
					set_option2(orden);					
				}
				orden=resultado.charAt(j);
			}
		}
		color_array.push(a1);
		return color_array;
	}
